create table ds_sys_sensitive_info
(
    id             bigint auto_increment comment '主键id字段'
        primary key,
    schema_name    varchar(50)                           not null comment 'schema',
    schema_id      varchar(36)                           null comment '关联schema表id',
    dbname         varchar(50)                           null comment '数据库名称',
    table_name     varchar(100)                          not null comment '表名',
    field_name     varchar(100)                          not null comment '字段名',
    data_type      varchar(100)                          not null comment '字段类型',
    incr_field     tinyint(1)  default 0                 null comment '是否为增量字段, 0否 1是，默认为0',
    algorithm_type varchar(10) default 'AES'             not null comment '加密算法类型：AES/MD5/SM3/SM4等，默认为AES',
    cipher_key     varchar(128)                          not null comment '秘钥，若为空给默认秘钥',
    create_time    timestamp   default CURRENT_TIMESTAMP null comment '创建时间',
    update_time    timestamp                             null on update CURRENT_TIMESTAMP comment '更新数据'
)
    comment '数据安全系统敏感信息表';

